import React, { Component } from 'react'
import { Button, Container, FlexCon, Inputsearch } from './stayle'

export default class Todo extends Component {
    constructor(props) {
        super(props)
        this.state = {
            modal: false
        }
    }
    render() {
        return (
            <div>
                <Container>
                    {/* menu search input b-n adduser */}
                    <FlexCon>
                        <Inputsearch placeholder=' Search' widthh/>
                        <Button onClick={() => this.setState({ modal: !this.state.modal })}>Add User </Button>
                    </FlexCon>
                    {/* INPUT search */}
                    {this.state.modal && <FlexCon>
                        <Inputsearch placeholder=' Firstname' />
                        <Inputsearch placeholder=' Lastname' />
                        <Inputsearch placeholder=' Address' />
                    </FlexCon>}
                </Container>
            </div>
        )
    }
}
